import React, { useEffect, useState } from "react";
import api from "./services/api";

export default function App() {

  const nameUsers : Array<any> = [];

  api
     .get("/v1/Users")
     .then((response) => (nameUsers.push(response.data)))
     .catch((err) => {
       console.error("ops! ocorreu um erro" + err);
     });

  nameUsers.forEach((data) => {
    console.log(data)
  })

  return (
    <div className="App">

    </div>  
  );
}
